// Crash.
require.config({ paths: { "jquery": "http://code.jquery.com/jquery" } });

var image = "data:image/jpeg;base64,";

define(function(require) {

  var $ = require("jquery").noConflict();

  function makeBigger(el) {
    el.animate({
      "font-size" : "5em"
    }, 1000, function() {
      el.animate({
        "font-size": "2em"
      }, 1000, function() {
        makeBigger(el);
      });
    });
  }

  return function(elem) {
    elem.innerHTML = 's';

    var $el = $(elem);

    $el.css({
      cursor: "pointer",
      color: "blue"
    });

    $el.on("mouseover", function() {
      $el.css("color", "purple");
      $('<img>', { src: image, id : 'strongbad' }).appendTo('body');
    });

    $el.on("mouseout", function() {
      $el.css("color", "blue");
      $('#strongbad').remove();
    });

    makeBigger($el);
  };
});


